export function sourceSansFonts(jsPDFAPI) {
  const fontNormal =
    // eslint-disable-next-line max-len
    '';
  const fontBold =
    // eslint-disable-next-line max-len
    '';

  const callAddFont = function () {
    this.addFileToVFS('SourceSans3-Regular.ttf', fontNormal);
    this.addFont('SourceSans3-Regular.ttf', 'SourceSans', 'normal');

    this.addFileToVFS('SourceSans3-Bold.ttf', fontBold);
    this.addFont('SourceSans3-Bold.ttf', 'SourceSans', 'bold');
  };
  jsPDFAPI.events.push(['addFonts', callAddFont]);
}
